import React, { useState } from "react";
import TimelineJigsaw from "../components/games/TimelineJigsaw";
import RiddleOfTheSages from "../components/games/RiddleOfTheSages";
import CulturalMatchUp from "../components/games/CulturalMatchUp";
import LegacyLineup from "../components/games/LegacyLineup";
import ArtisansEye from "../components/games/ArtisansEye";
import FactOrFiction from "../components/games/FactOrFiction";
import mauryanSaga from '../data/mauryanEmpire.json';
import triviaSaga from '../data/culturalTrivia.json';
import imageData from '../data/imageData.json';

const allSagas = [
  { ...mauryanSaga, progress: 25, image: imageData.sagaImages.mauryan }, 
  { ...triviaSaga, progress: 0, image: imageData.sagaImages.culture }
];

const QuestItem = ({ icon, title, onClick }) => (
  <button
    onClick={onClick}
    className="flex items-center justify-between w-full p-4 text-left transition-all duration-300 ease-in-out bg-slate-100 rounded-lg border border-slate-200 disabled:opacity-60 enabled:hover:border-teal-400 enabled:hover:bg-white enabled:hover:scale-105"
  >
    <div className="flex items-center">
      <div className="mr-4 text-teal-500">{icon}</div>
      <div>
        <h4 className="font-bold text-slate-800">{title}</h4>
        <p className="text-sm text-slate-500">Ready to Play!</p>
      </div>
    </div>
    <div className="text-right">
      <p className="font-bold text-green-600">+150 QP</p>
    </div>
  </button>
);

const SagaCard = ({ saga, onQuestStart }) => (
  <div className="bg-white rounded-2xl border border-slate-200 shadow-lg overflow-hidden">
    <div 
      className="p-6 h-48 flex flex-col justify-end relative text-white bg-cover bg-center"
      style={{backgroundImage: `url(${saga.image})`}}
    >
      <div className="absolute inset-0 bg-gradient-to-t from-black/70 to-transparent"></div>
      <div className="relative z-10">
        <h3 className="text-3xl font-bold text-white drop-shadow-lg">{saga.title}</h3>
        <p className="mt-1 text-slate-200 drop-shadow-md">{saga.description}</p>
      </div>
    </div>

    <div className="p-4 border-b border-slate-200">
      <div className="flex justify-between items-center mb-2">
        <p className="text-sm font-semibold text-slate-700">Saga Progress</p>
        <p className="text-sm font-bold text-red-500">{saga.progress}%</p>
      </div>
      <div className="w-full bg-slate-200 rounded-full h-3">
        <div 
          className="bg-gradient-to-r from-orange-400 to-red-500 h-3 rounded-full transition-all duration-500" 
          style={{ width: `${saga.progress}%` }}
        ></div>
      </div>
    </div>

    <div className="p-6 bg-slate-50/70 space-y-4">
      {saga.games.timelineJigsaw && <QuestItem icon={<svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor" strokeWidth={2}><path strokeLinecap="round" strokeLinejoin="round" d="M8 7V3m8 4V3m-9 8h10M5 21h14a2 2 0 002-2V7a2 2 0 00-2-2H5a2 2 0 00-2 2v12a2 2 0 002 2z" /></svg>} title="Timeline Jigsaw" onClick={() => onQuestStart('timelineJigsaw')} />}
      {saga.games.riddleOfTheSages && <QuestItem icon={<svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor" strokeWidth={2}><path strokeLinecap="round" strokeLinejoin="round" d="M8.228 9c.549-1.165 2.03-2 3.772-2 2.21 0 4 1.343 4 3 0 1.4-1.278 2.575-3.006 2.907-.542.104-.994.54-.994 1.093m0 3h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z" /></svg>} title="Riddle of the Sages" onClick={() => onQuestStart('riddleOfTheSages')} />}
      {saga.games.legacyLineup && <QuestItem icon={<svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor" strokeWidth={2}><path strokeLinecap="round" strokeLinejoin="round" d="M3 10h18M3 14h18m-9-4v8m-7 0h14a2 2 0 002-2V8a2 2 0 00-2-2H5a2 2 0 00-2 2v8a2 2 0 002 2z" /></svg>} title="Legacy Lineup" onClick={() => onQuestStart('legacyLineup')} />}
      {saga.games.culturalMatchUp && <QuestItem icon={<svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor" strokeWidth={2}><path strokeLinecap="round" strokeLinejoin="round" d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z" /><path strokeLinecap="round" strokeLinejoin="round" d="M15 11a3 3 0 11-6 0 3 3 0 016 0z" /></svg>} title="Cultural Match-Up" onClick={() => onQuestStart('culturalMatchUp')} />}
      {saga.games.artisansEye && <QuestItem icon={<svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor" strokeWidth={2}><path strokeLinecap="round" strokeLinejoin="round" d="M15 12a3 3 0 11-6 0 3 3 0 016 0z" /><path strokeLinecap="round" strokeLinejoin="round" d="M2.458 12C3.732 7.943 7.523 5 12 5c4.478 0 8.268 2.943 9.542 7-1.274 4.057-5.064 7-9.542 7-4.477 0-8.268-2.943-9.542-7z" /></svg>} title="Artisan's Eye" onClick={() => onQuestStart('artisansEye')} />}
      {saga.games.factOrFiction && <QuestItem icon={<svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor" strokeWidth={2}><path strokeLinecap="round" strokeLinejoin="round" d="M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z" /></svg>} title="Fact or Fiction" onClick={() => onQuestStart('factOrFiction')} />}
    </div>
  </div>
);

export default function Quests() {
  const [activeGame, setActiveGame] = useState(null);

  const handleGameComplete = () => setActiveGame(null);

  if (activeGame === "timelineJigsaw") return <TimelineJigsaw onGameComplete={handleGameComplete} />;
  if (activeGame === "riddleOfTheSages") return <RiddleOfTheSages onGameComplete={handleGameComplete} />;
  if (activeGame === "legacyLineup") return <LegacyLineup onGameComplete={handleGameComplete} />;
  if (activeGame === "culturalMatchUp") return <CulturalMatchUp onGameComplete={handleGameComplete} />;
  if (activeGame === "artisansEye") return <ArtisansEye onGameComplete={handleGameComplete} />;
  if (activeGame === "factOrFiction") return <FactOrFiction onGameComplete={handleGameComplete} />;

  return (
    <section className="space-y-12">
      <div>
        <h2 className="text-4xl font-extrabold tracking-tight text-slate-900">Sagas & Quests 📚</h2>
        <p className="mt-2 text-lg text-slate-600">Complete all quests in a saga to master the topic and earn a new badge!</p>
